// 余额展示组件
const BalanceDisplay: React.FC<{
  balanceInfo: string;
  loading?: boolean;
}> = ({ balanceInfo, loading = false }) => {
  const { token } = theme.useToken();
  const intl = useIntl();

  // 解析余额信息
  const parseBalanceInfo = (info: string) => {
    if (!info || info === '-') return [];

    return info.split('|').map(item => {
      const trimmed = item.trim();
      // 匹配币种符号和金额 - 支持格式: "HK $259,152.94", "KR ₩59,511.97" 等
      const match = trimmed.match(/^([A-Z]{2})\s+([¥$€₩£])\s*([\d,]+\.?\d*)$/);
      if (match) {
        return {
          currency: match[1],
          symbol: match[2],
          amount: match[3]
        };
      }
      return null;
    }).filter(Boolean);
  };

  const balanceItems = parseBalanceInfo(balanceInfo);

  if (loading) {
    return (
      <Card
        style={{
          backgroundColor: token.colorBgContainer,
          boxShadow: token.boxShadow,
          borderRadius: '8px',
          textAlign: 'center',
        }}
        loading={true}
      />
    );
  }

  return (
    <Card
      style={{
        backgroundColor: token.colorBgContainer,
        boxShadow: token.boxShadow,
        borderRadius: '8px',
        textAlign: 'center',
        height: '100%',
        display: 'flex',
        flexDirection: 'column',
      }}
      bodyStyle={{
        flex: 1,
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'flex-start',
        padding: '24px 16px',
      }}
    >
      <div style={{ 
        fontSize: '14px', 
        color: token.colorTextSecondary, 
        marginBottom: '16px',
        textAlign: 'center'
      }}>
        {intl.formatMessage({ id: 'pages.welcome.balanceAfterFees' })}
      </div>

      {balanceItems.length > 0 ? (
        <div style={{ display: 'flex', flexDirection: 'column', gap: '8px' }}>
          {balanceItems.map((item, index) => (
            <div
              key={index}
              style={{
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'space-between',
                padding: '6px 10px',
                backgroundColor: token.colorBgLayout,
                borderRadius: '6px',
                border: `1px solid ${token.colorBorderSecondary}`,
              }}
            >
              <div style={{ display: 'flex', alignItems: 'center', gap: '6px' }}>
                {/* 币种图标 */}
                <div
                  style={{
                    width: '20px',
                    height: '20px',
                    borderRadius: '50%',
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'center',
                    fontSize: '10px',
                    fontWeight: 'bold',
                    color: '#fff',
                    backgroundColor: getCurrencyColor(item?.currency || ''),
                  }}
                >
                  {getCurrencyIcon(item?.currency || '')}
                </div>

                {/* 币种名称 */}
                <span style={{ 
                  fontSize: '13px', 
                  fontWeight: '500',
                  color: token.colorText 
                }}>
                  {item?.currency}
                </span>
              </div>

              {/* 余额金额 */}
              <span style={{ 
                fontSize: '14px', 
                fontWeight: 'bold',
                color: token.colorPrimary 
              }}>
                {item?.symbol} {item?.amount}
              </span>
            </div>
          ))}
        </div>
      ) : (
        <div style={{ 
          textAlign: 'center', 
          color: token.colorTextSecondary,
          fontSize: '14px'
        }}>
          No balance information available
        </div>
      )}
    </Card>
  );
};

// 获取币种颜色
const getCurrencyColor = (currency: string): string => {
  const colors: { [key: string]: string } = {
    'HK': '#1890ff', // 蓝色
    'KR': '#52c41a', // 绿色
    'EU': '#722ed1', // 紫色
    'US': '#fa8c16', // 橙色
    'CN': '#f5222d', // 红色
  };
  return colors[currency] || '#8c8c8c';
};

// 获取币种图标
const getCurrencyIcon = (currency: string): string => {
  const icons: { [key: string]: string } = {
    'HK': 'HK',
    'KR': 'KR',
    'EU': '€',
    'US': '$',
    'CN': '¥',
  };
  return icons[currency] || currency;
};

// 统计卡片组件
const SummaryCard: React.FC<{
  title: string;
  value?: string | number;
  loading?: boolean;
  children?: React.ReactNode;
}> = ({ title, value, loading = false, children }) => {
  const { token } = theme.useToken();

  return (
    <Card
      style={{
        backgroundColor: token.colorBgContainer,
        boxShadow: token.boxShadow,
        borderRadius: '8px',
        textAlign: 'center',
        height: '100%',
      }}
      loading={loading}
    >
      {children ? (
        children
      ) : (
        <Statistic
          title={title}
          value={value}
          valueStyle={{ color: token.colorPrimary, fontSize: '24px', fontWeight: 'bold' }}
        />
      )}
    </Card>
  );
};

// 商户信息项组件
const InfoItem: React.FC<{
  label: string;
  value: string;
}> = ({ label, value }) => {
  const { token } = theme.useToken();

  return (
